import styled from 'styled-components'
import back from '../../assets/undraw_investing.png'

export const Container = styled.div`
  width: 100%;
  flex: 1 1 100%;
  padding: 45px 8px;
  display: flex;
  flex-direction: column;
  height: 100vh;
  position: relative;
  /* background-size: 1000px 4000px; */
  background: url(${back});
  background-repeat: no-repeat;
`
